import Blog from "./pages/Blog";
import Cart from "./pages/Cart";
import Contact from "./pages/Contact";
import Homepage from "./pages/Homepage";
import Login from "./pages/Login";
import NotFoundpage from "./pages/NotFoundpage";
import Register from "./pages/Register";
import Auth from './pages/Auth'
const routes = [
    {
        path:'',
        exact:'false',
       component: Homepage
    },
    {
        path:'/auth',
        exact:'false',
       component: Auth
    },
    {
        path:'/shopdetail',
        exact:'false',
       component: Shi
    },
    {
        path:'/contact',
        exact:'false',
       component: Contact
    
    },
    {
        path:'/shoping-cart',
        exact:'false',
       component: Cart
    
    },
    {
        path:'/blog',
        exact:'false',
       component: Blog
    
    },
    {
        path:'/notfound',
        exact:'false',
        layout: null,
       component: NotFoundpage
    
    },
    {
        path:'/login',
        layout: null,
       component: Login
    
    },
    {
        path:'/register',
   
        layout: null,
       component: Register
    
    }
   
]
export { routes}
